synopsis:
This is a joyous and adventurous story about protecting natural symbiosis and solving puzzles. In our story, five partners with different personalities are a united whole:
Strong and keen navigator and captain-Dolphin Ke Lanbo;
An optimistic and whimsical music lover and power manager-Conger Barry;
Shy and patient mechanical engineer and inventor-Crab Rob;
A studious and wise science doctor and recorder-Turtle Xiaodi;
And the most kind and caring health expert and doctor-Squid Sweet Cocoa.
Captain Ke Lanbo drove the Bangbang Express, which can travel up to the world, sea and land, and four other team members, traveling in a group of ecosystems around the world. Bangbang members have their own personalities and specialties. They face difficulties together and are the best partners. When rescuing the creatures, the five people drove their super boats to form a huge robot-to help the superman, to help the trapped creature.
In the new stage of the adventure, Bangbang Express will go to the colorful ecosystems in the world, the ice and snowy Antarctica, the dark and mysterious seabed, and the vibrant coral reefs... where they start various adventures. , Discover the laws that animals get along with nature, and then learn and grow under repeated difficulties.
At the end of each adventure, the Dolphin Gang’s partners will return to Gangbang Express to review this classic adventure in the cozy little squid restaurant. Sweet cocoa will bring you the most delicious dessert. This is a warm reward time for every adventure, so that every partner loves this team more. 
